  'Our Vision' => 'Our Vision (traduit en français)',
  'Based on patient satisfaction, we aim to be a pioneer in health tourism with our health and 100% customer satisfaction focused services, innovative dental clinics and patient-centered processes. With our clinics equipped with the latest technology and our strong organization, we strive to maintain our leadership and grow in the oral and dental health sector.' => 'Based on patient satisfaction, we aim to be a pioneer in health tourism with our health and 100% customer satisfaction focused services, innovative dental clinics and patient-centered processes. With our clinics equipped with the latest technology and our strong organization, we strive to maintain our leadership and grow in the oral and dental health sector. (traduit en français)',
  'Our Mission' => 'Our Mission (traduit en français)',
  'We aim for global expansion by embracing new technologies, supporting health tourism investments, and prioritizing dental health and patient satisfaction. With a strong global network, multilingual staff, and a 100% patient-focused approach, we provide comprehensive dental solutions in state-of-the-art, luxurious clinics, ensuring effortless access to healthy, beautiful smiles.' => 'Nous adoptons continuellement les nouvelles technologies en matière de soins bucco-dentaires, accueillons les investissements qui stimulent le tourisme de santé, et restons fidèles à notre engagement envers la satisfaction des patients. Notre objectif est d’offrir des services dentaires et esthétiques complets aux patients du monde entier grâce à une équipe multilingue centrée sur le client. En combinant technologie avancée et cliniques modernes et luxueuses, nous garantissons des sourires sains et éclatants à tous.',
  'About' => 'About (traduit en français)',
  'Founder' => 'Fondatrice',
  'Dr. Gülay Akay, a doting and ambitious mother of three, turned her lifelong passion into a full-time career and never looked back. She has more than 16 years of experience in cosmetic dentistry, dental implantology, same-day dentistry as well as bone grafting, laser dentistry and digital smile design.' => 'Dr Gülay Akay, mère attentionnée et ambitieuse de trois enfants, a transformé sa passion de toujours en une carrière à temps plein, sans jamais revenir en arrière. Elle possède plus de 16 ans d’expérience en dentisterie esthétique, implantologie dentaire, soins dentaires en une journée, greffes osseuses, dentisterie au laser et design numérique du sourire.',
  'With a vision to redefine the dental industry, Dr. Gülay laid foundations of Dentakay and worked relentlessly to turn it into a massive, prominent brand. Her extensive experience in dentistry coupled with her relentless strive for excellence enabled her to establish Dentakay as a leader in the health tourism sector. Since the beginning, Dr. Gülay\'s ultimate goal was 100% patient satisfaction and it is still the foundational basis and backbone of Dentakay.' => 'With a vision to redefine the dental industry, Dr. Gülay laid foundations of Dentakay and worked relentlessly to turn it into a massive, prominent brand. Her extensive experience in dentistry coupled with her relentless strive for excellence enabled her to establish Dentakay as a leader in the health tourism sector. Since the beginning, Dr. Gülay\'s ultimate goal was 100% patient satisfaction and it is still the foundational basis and backbone of Dentakay. (traduit en français)',
